import React from "react";
import logo from '../images/Logos-light/Logo-standalone-default-full-colour@1x.svg'
import theme from './ThemeProvider'

const MB = () => {
    return(
        <div className='head2'>
            <img 
                className="App-logo"
                src={
                    theme === "dark"
                    ? "../images/Logos-dark/Logo-standalone-default-full-colour@1x.svg"
                    : "../images/Logos-light/Logo-standalone-default-full-colour@1x.svg"
                }
                alt="logo"
                sx ={{ height:'94px', width:'375.06px' }}
                />
            <h1 className="map-all-build-details"> MapAll Build Details </h1> 
        </div>
    );
}

export default MB;
